                text += f"  ‚Ä¢ Projetos (~/.claude/projects/)\n"
                text += f"  ‚Ä¢ CLAUDE.md\n"
            elif result["status"] == "already_running":
                text = "‚ö†Ô∏è Monitor j√° est√° em execu√ß√£o"
            else:
